import React from 'react'
import EventList from './EventList';
import './Events.css'


const events = [
  { title: 'React Conference', date: '2024-09-01', description: 'A conference about React.' },
  { title: 'JavaScript Meetup', date: '2024-10-15', description: 'A meetup for JavaScript enthusiasts.' },
];

const Events = (event) => {
  return (
    <div className="App">
      <h1>Upcoming Events</h1>
      <EventList events={events} />
    </div>
  );
};
 


export default Events
